import React from 'react';
import Wiki from './components/Search';

class App extends Component {

  render () {
    return (
      <div className="App">
        <div className="jumbotron">
          <p className="lead text-center">Rick and Morty Wiki</p>

          <Wiki
            message="Wiki..."
          />
        </div>
      </div>
    );
  }
}

export default App;
